import React, { Component } from 'react';
import './App.css';
import Profile from './Components/Profile.js';
import Experiences from './Components/Experiences.js';
import Projects from './Components/Projects.js';
import Contact from './Components/Contact.js';
import Abilities from './Components/Abilities.js';
import Name from './Components/Name.js';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

class App extends Component {

  render() {
    return (
      <Router>
        <div className="app">
        <div className="navcontainer">
        <nav className="navbar">
          <ul className="navlist">
            <li><Link className="link" to={'/'}>HOME</Link></li>
            <li><Link className="link" to={'/profile'}>PROFILE</Link></li>
            <li><Link className="link" to={'/experiences'}>EXPERIENCES</Link></li>
            <li><Link className="link" to={'/abilities'}>ABILITIES</Link></li>
            <li><Link className="link" to={'/projects'}>PROJECTS</Link></li>
            <li><Link className="link" to={'/contact'}>CONTACT</Link></li>
          </ul>
        </nav>
        </div>


         <Switch>
           <Route exact path="/" component = {Name}/>
           <Route path ='/profile' component={Profile}/>
           <Route path ='/experiences' component={Experiences}/>
           <Route path ='/abilities' component={Abilities}/>
           <Route path ='/projects' component={Projects}/>
           <Route path ='/contact' component={Contact}/>
         </Switch>
        </div>
      </Router>
    );
  }
}

export default App;
